// ─── Config ───────────────────────────────────────────────────────────────
const WINDOW_SECONDS = 10;
const VELOCITY_THRESHOLD = 3; // px/sec - below this = stationary
// ──────────────────────────────────────────────────────────────────────────

function getCentroid(polygon) {
  const coords = polygon?.coordinates?.[0] ?? [];
  if (coords.length === 0) return null;
  const xs = coords.map(c => c[0]);
  const ys = coords.map(c => c[1]);
  return {
    x: (Math.min(...xs) + Math.max(...xs)) / 2,
    y: (Math.min(...ys) + Math.max(...ys)) / 2
  };
}

function calcMovingState(primaryTrackId, interactionTrackId, referenceTimestamp, rawDetections, windowSeconds, velocityThreshold) {
  const windowMs = windowSeconds * 1000;
  const refTime = new Date(referenceTimestamp).getTime();

  // ✅ Use interactionTrackId (matching track) to look up raw detections
  const detections = rawDetections?.[interactionTrackId] ?? [];
  if (detections.length === 0) {
    return { error: `No raw detections found for matching track: ${interactionTrackId}`, wasMoving: false };
  }

  const windowDetections = detections
    .filter(d => {
      const t = new Date(d.timestamp).getTime();
      return t >= (refTime - windowMs) && t <= (refTime + windowMs);
    })
    .sort((a, b) => new Date(a.timestamp) - new Date(b.timestamp));

  if (windowDetections.length < 2) {
    return {
      error: 'Not enough detections in window to calculate velocity',
      wasMoving: null,
      detections_in_window: windowDetections.length
    };
  }

  const velocities = [];
  for (let i = 1; i < windowDetections.length; i++) {
    const prev = windowDetections[i - 1];
    const curr = windowDetections[i];
    const c1 = getCentroid(prev.polygon);
    const c2 = getCentroid(curr.polygon);
    if (!c1 || !c2) continue;
    const dx = c2.x - c1.x;
    const dy = c2.y - c1.y;
    const distPx = Math.sqrt(dx * dx + dy * dy);
    const dtSec = (new Date(curr.timestamp) - new Date(prev.timestamp)) / 1000;
    if (dtSec <= 0) continue;
    velocities.push(distPx / dtSec);
  }

  if (velocities.length === 0) {
    return { error: 'Could not compute velocity from detections', wasMoving: null };
  }

  const avgVelocity = velocities.reduce((a, b) => a + b, 0) / velocities.length;
  const maxVelocity = Math.max(...velocities);

  return {
    primary_track_id: primaryTrackId,
    matching_track_id: interactionTrackId,
    reference_timestamp: referenceTimestamp,
    window_seconds: windowSeconds,
    detections_in_window: windowDetections.length,
    velocity_threshold_px_per_sec: velocityThreshold,
    avg_velocity_px_per_sec: Math.round(avgVelocity * 1000) / 1000,
    max_velocity_px_per_sec: Math.round(maxVelocity * 1000) / 1000,
    wasMoving: avgVelocity >= velocityThreshold
  };
}

// ── Main ──────────────────────────────────────────────────────────────────
return $input.all().map(item => {
  const data = item.json;

  const primaryTrackId = data.checks?.type3?.primary_track_id;
  const interactionDetails = data.checks?.type3?.interaction_details ?? {};
  const rawDetections = data.raw_detections ?? {};

  if (!primaryTrackId) {
    return { json: { ...data, primary_moving_state: [{ error: 'No primary_track_id found', wasMoving: false }] } };
  }

  const primary_moving_state = Object.values(interactionDetails)
    .filter(d => d.passed === true)
    .map(interaction => {
      const referenceTimestamp = interaction.thresholds?.distance?.at
        ?? interaction.thresholds?.overlap?.at
        ?? interaction.first_interaction_at;

      if (!referenceTimestamp) {
        return {
          primary_track_id: primaryTrackId,
          matching_track_id: interaction.track_id,
          error: 'No reference timestamp found',
          wasMoving: false
        };
      }

      return calcMovingState(
        primaryTrackId,
        interaction.track_id,  // this is passed as interactionTrackId
        referenceTimestamp,
        rawDetections,
        WINDOW_SECONDS,
        VELOCITY_THRESHOLD
      );
    });

  if (primary_moving_state.length === 0) {
    return { json: { ...data, primary_moving_state: [{ error: 'No passing type3 interactions found', wasMoving: false }] } };
  }

  return { json: { ...data, primary_moving_state } };
});
